script: |
  super -f text -I q888.spq | sort > q888.out

inputs:
  - name: q888.spq
    data: |
      SELECT DISTINCT + col2 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT IN ( - 15 + - - col2 + + - col1 + - 8 * - - 83 / - - col2 - + - col2, col2, col0 + + 43, + col2, - 26 );
  - name: tab1

outputs:
  - name: q888.out
    data: |
